"""
This module contains functions to automatically determine the cluster resolution of a umap.
"""
import base64
from io import BytesIO
import scanpy as sc
import matplotlib.pyplot as plt

from anndata import AnnData

from anndict.llm.llm_call import call_llm

#image understanding functions
def encode_plot_for_openai(plot):
    """Encodes images for openai api"""
    buffer = BytesIO()
    plot()
    plt.savefig(buffer, format='png')
    buffer.seek(0)
    encoded_image = base64.b64encode(buffer.read()).decode('utf-8')
    plt.close()
    return encoded_image


def ai_resolution_interpretation(plot: callable) -> str:
    """
    Determines the clustering resolution adjustment based on an image of a plot using AI.

    Parameters
    ------------
    plot
        A function that generates a ``matplotlib`` plot.

    Returns
    ---------
    The resolution adjustment suggestion generated by LLM. 
    One of ``"decreased"``, ``"increased"``, or ``"unchanged"``.
    """
    #convert plot to base64
    encoded_image = encode_plot_for_openai(plot)

    # Prepare the messages for the Chat Completions API

    # Example images encoded as base64
    oversplit_example = ""
    well_split_example = ""
    undersplit_example = ""

    #Prepare messages
    messages = [
        {"role": "system", "content": "You are a nit-picking data scientist who decides if the clustering resolution should be 1) decreased 2) increased 3) unchanged. You only respond with one of these three words."},
        {"role": "user", "content": [
            {"type": "image_url", "image_url": {"url": f"data:image/png;base64,{oversplit_example}"}}
        ]},
        {"role": "user", "content": "decreased"},
        {"role": "user", "content": [
            {"type": "image_url", "image_url": {"url": f"data:image/png;base64,{undersplit_example}"}}
        ]},
        {"role": "user", "content": "increased"},
        {"role": "user", "content": [
            {"type": "image_url", "image_url": {"url": f"data:image/png;base64,{well_split_example}"}}
        ]},
        {"role": "user", "content": "unchanged"},
        {"role": "user", "content": [
            {"type": "image_url", "image_url": {"url": f"data:image/png;base64,{encoded_image}"}}
        ]}
    ]

    # Call the LLM using the call_llm function
    annotation = call_llm(
        messages=messages,
        max_tokens=30,
        temperature=0
    )

    return annotation


def determine_sign_of_resolution_change(annotation: str) -> int:
    """
    Determines the sign of resolution change based on an input string.

    Parameters
    ------------
    annotation
        Annotation indicating resolution change.

    Returns
    --------
    ``-1`` for ``"decreased"``, ``1`` for ``"increased"``, ``0`` for ``"unchanged"`` or ``None``.
    """
    # pylint check disabled for readability and future-proofing
    if "decreased" in annotation: # pylint: disable=no-else-return
        return -1
    elif "increased" in annotation:
        return 1
    elif "unchanged" in annotation:
        return 0
    else:
        return 0


def ai_determine_leiden_resolution(
    adata: AnnData,
    initial_resolution: float
    ) -> float:
    """
    Adjusts the Leiden clustering resolution of an AnnData object based on LLM feedback.

    This function iteratively performs Leiden clustering on the AnnData object,
    generates a UMAP plot, and uses an LLM model to interpret the plot and suggest
    whether to increase, decrease, or maintain the current resolution. The resolution
    is adjusted by 0.1 based on the LLM's suggestion until no further adjustment is needed.

    Parameters
    ------------
    adata
        An :class:`AnnData` object.

    initial_resolution
        The initial resolution for Leiden clustering.

    Returns
    ---------
    The final ``resolution`` value after adjustments based on LLM interpretation.
    """
    resolution = initial_resolution
    previous_sign_change = None

    k = 0
    while k <= 10:
        sc.tl.leiden(adata, resolution=resolution)

        # Plot UMAP colored by Leiden clusters
        def plot_umap():
            sc.pl.umap(adata, color='leiden', show=False)

        # Get AI interpretation
        annotation = ai_resolution_interpretation(plot_umap)

        # Determine the sign of resolution change
        sign_change = determine_sign_of_resolution_change(annotation)

        # Check if the resolution needs to be adjusted
        # pylint check disabled for readability
        if sign_change == 0: # pylint: disable=no-else-return
            return resolution
        elif previous_sign_change is not None and sign_change != previous_sign_change:
            resolution = round(resolution + 0.15 * sign_change, 2)
            return resolution
        else:
            resolution = round(resolution + 0.15 * sign_change, 2)

        previous_sign_change = sign_change
        k = k + 1

    return resolution
